import PropTypes from 'prop-types'

import { 
  BrowserRouter,
  Routes,
  Route,
  useNavigate,
  Link, 
  Navigate
} from "react-router-dom";
import {
  createUserWithEmailAndPassword,
  signInWithEmailAndPassword,
  onAuthStateChanged,
  getAuth,
  signOut,
} from "firebase/auth";
import { auth } from "../firebase";


const Rooms = ({userName}) => {
  let navigate = useNavigate();

  const back = async () => {
    navigate('/Dashboard');
  }

  const createRoom = async () => {
    navigate('/Dashboard');
  }

  const joinExistingRoom = async () => {
    navigate('/Dashboard');
  }

  return (
    <div>
      <h1> Rooms {userName}</h1>
      <button onClick={back}> Back to Dashboard </button>
      <button onClick={createRoom}> Join Existing Room </button>

      <button onClick={joinExistingRoom}> Join Existing Room </button>


      </div>
  )
}

Rooms.propTypes = {
  userName: 'User123',
}

export default Rooms
